import db from '../models/index'

const getProjectAndUser = async () => {
    try {
        let project = await db.Project.findAll({
            where: {
                status: '1',
            },
            include: { model: db.Userstudent },
            order: [['id', 'ASC']]
        });
        if (project) {
            return {
                EM: 'GET DATA SUCCESS!',
                EC: 0,
