// TeacherAuthMiddleware.js
import jwt from 'jsonwebtoken';
import dotenv from 'dotenv';
import db from '../models/index'; // Để truy vấn database

dotenv.config();

const extractToken = (req) => {
    if (req.headers.authorization && req.headers.authorization.split(' ')[0] === 'Bearer') {
        return req.headers.authorization.split(' ')[1];
    }
    return null;
};

const verifyToken = (token) => {
    let key = process.env.JWT_SECRET;
    try {
        return jwt.verify(token, key);
    } catch (err) {
        console.log("Token verification error:", err);
        return null;
    }
};

const teacherAuth = async (req, res, next) => {
    const token = extractToken(req);
    if (token) {
        const decoded = verifyToken(token);
        if (decoded) {
            // Kiểm tra group để xác định UserTeacher
            if (decoded.groupId === 2) { // Giả sử groupId = 2 là nhóm UserTeacher
                req.user = {
                    userteacherId: decoded.userteacherId,
                    role: decoded.role,
                    groupId: decoded.groupId
                };

                // Kiểm tra quyền role từ bảng Role để xem người dùng có quyền truy cập vào URL này không
                const roles = await db.Role.findAll({
                    include: [{
                        model: db.Group,
                        where: { id: req.user.groupId },
                        through: { attributes: [] } // Để lọc chỉ các trường cần thiết
                    }]
                });

                const currentUrl = req.path;
                const hasPermission = roles.some(role => role.url === currentUrl);

                if (hasPermission) {
                    return next();
                } else {
                    return res.status(403).json({
                        EC: -1,
                        EM: 'Access denied. You do not have permission to access this resource.',
                        DT: ''
                    });
                }
            } else {
                return res.status(403).json({
                    EC: -1,
                    EM: 'Access denied. This API is only accessible to UserTeacher.',
                    DT: ''
                });
            }
        } else {
            return res.status(401).json({
                EC: -1,
                EM: 'Not authenticated',
                DT: ''
            });
        }
    } else {
        return res.status(401).json({
            EC: -1,
            EM: 'Authorization token is missing',
            DT: ''
        });
    }
};

export default teacherAuth;

